import React from "react";
import styled from "styled-components";

const MiniFlags = ({ id, flag }) => {
  return (
    <FlagForm>
      <div>
        <img src={flag} alt="flag" />
        <p>{id}</p>
      </div>
    </FlagForm>
  );
};

export default MiniFlags;

const FlagForm = styled.div`
  display: flex;
  flex-direction: column;
  width: 5rem;
  height: 5rem;
  text-align: center;
  img {
    height: 3rem;
    object-fit: cover;
  }
  p {
    margin: 0;
  }
`;
